roups']=0.300000,['Color']=2403,['SizeZ']=17,['Roll']=0,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['X']=16328,['Id']=2522,['Z']=31717,['Yaw']=3.309144,['Pitch']=0,},[492]={['SizeY']=17,['Contrast']=0.250000,['EffectType']=839,['Alpha']=1,['Y']=12532,['SizeX']=11,['Groups']=0.300000,['Color']=6510,['SizeZ']=17,['Roll']=0,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['X']=16381,['Id']=2523,['Z']=31707,['Yaw']=3.309144,['Pitch']=0,},[493]={['Contrast']=1.660000,['Roll']=0,['Alpha']=1,['SizeY']=16,['SizeX']=30,['Groups']=0,['EffectType']=882,['SizeZ']=16,['Color']=912,['X']=16377,['Y']=12546,['Id']=2524,['Z']=31709,['Yaw']=0.265290,['Pitch']=0,},[494]={['Contrast']=1.620000,['Roll']=0,['Alpha']=1,['SizeY']=16,['SizeX']=30,['Groups']=0,['EffectType']=882,['SizeZ']=16,['Color']=912,['X']=16331,['Y']=12546,['Id']=2525,['Z']=31718,['Yaw']=3.204425,['Pitch']=0,},[495]={['SizeY']=127,['Contrast']=0.340000,['EffectType']=839,['Alpha']=1,['Y']=12485,['SizeX']=42,['Groups']=0.150000,['Color']=7498,['SizeZ']=127,['Roll']=0,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['X']=16352,['Id']=2526,['Z']=31699,['Yaw']=3.309144,['Pitch']=0,},[496]={['SizeY']=262,['Contrast']=0.820000,['EffectType']=839,['Alpha']=0.700000,['Y']=12498,['SizeX']=87,['Groups']=0.250000,['Color']=0,['SizeZ']=262,['Roll']=0,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['X']=16350,['Id']=2530,['Z']=31695,['Yaw']=3.309144,['Pitch']=0,},[497]={['SizeY']=52,['Contrast']=1.640000,['EffectType']=8501,['Alpha']=1,['Y']=11754,['SizeX']=33.456460,['Groups']=1,['Color']=350700,['SizeZ']=52,['Roll']=0,['MetaData']={['message']='\\nThis is Batman.\\nSecurity level: Omega\\nPassword: Delta Charlie - 27 - 5 - 1939\\n\\nEnable new protocol, title: Agamemno Contingency.\\n\\nShould any of the core members of the league turn rogue, we need to have plans in place to handle each and every one of us should we become a threat. The members of the league are my teammates. But we need to be prepared for the worst always.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file code name: Last Son.\\n\\nIf Superman ever becomes a threat to the planet, the following protocols will need to be enacted to ensure our survival. A sample of Green Kryptonite in vault 7B, provided by Superman himself, will incapacitate him with brief exposure, and prolonged exposure would in all probability; be fatal. Portions of this kryptonite, under exposure to radiation created a variation of kryptonite that is red in color, side effects of this type of kryptonite are unknown, further testing is required.',['title']='-Data 1-',},['X']=22835.701238,['Id']=2534,['Z']=27934.045672,['Yaw']=0.265290,['Pitch']=0,},[498]={['SizeY']=52,['Contrast']=1.600000,['EffectType']=8501,['Alpha']=1,['Y']=11754,['SizeX']=30.456456,['Groups']=1,['Color']=350700,['SizeZ']=52,['Roll']=0,['MetaData']={['message']='\\nAgamemno Contingency, file codename: Red Sands.\\n\\nJ\\'onn J\\'onzz, the manhunter from mars is the heart and soul of the Justice League. However, his strength and speed make him a formidable opponent should he ever turn against us. His vulnerability to fire would be hard to exploit in a defensive position. However, research suggests that a nanite virus spiked with magnesium would cause his skin to combust in contact with the air, neutralizing him as a threat, must investigate further.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file codename: 2814.\\n\\nThe ring of the Green Lantern is the most powerful weapon in the universe, limited only by the imagination of the bearer. The ring cannot be separated from the wielder except in the event of their death and the rings natural defenses prevent direct attack. But in order to use the ring, the core member needs to be able to see what they\\'re doing. While an attack on the eyes would be ill advised due to the defenses of the ring, see table 38b for full offensive lists and their intended probabilities of success. Research indicates that a post hypnotic suggestion could be planted into the Green Lantern\\'s psyche, causing them to believe themselves blind. The ring would then make them blind, enforced by their own will power. Must test out this theory on Guy Gardner.',['title']='-Data 2-',},['X']=22787,['Id']=2535,['Z']=27950,['Yaw']=0.265290,['Pitch']=0,},[499]={['SizeY']=52,['Contrast']=1.540000,['EffectType']=8501,['Alpha']=1,['Y']=11754,['SizeX']=30.456460,['Groups']=1,['Color']=350700,['SizeZ']=52,['Roll']=0,['MetaData']={['message']='\\nAgamemno Contingency, file codename: Olympus.\\n\\nDiana is a good friend, which is just one reason it would be difficult to face her in combat should she turn against the league, it\\'s not a thought I relish. But if it must be done, the following strategy could be useful. If she could be convinced that she is fighting an equal, she could then theoretically be trapped in a non-ending cycle of combat against a phantom opponent, must investigate feasibility of neural virtual reality technology.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file codename: Polymer\\n\\nPlastic Man, a unique opponent. Every molecule of his body is under his command, and he can make himself into anything he imagines. We\\'re lucky that he is on our side and that he\\'s more concerned with being comic relief than anything else. But should he turn, freezing him with liquid nitrogen or some other agents is the best emergency response I\\'ve been able to identify. After that, its just a question of storage.',['title']='-Data 3-',},['X']=22736,['Id']=2536,['Z']=27964,['Yaw']=0.261799,['Pitch']=0,},[500]={['SizeY']=23,['Contrast']=1.660000,['EffectType']=4404,['Alpha']=0.750000,['Y']=11799,['SizeX']=250,['Groups']=2.080000,['Color']=999451,['SizeZ']=23,['Roll']=0,['MetaData']={['message']='Agamemno      Contingency',},['X']=22675,['Id']=2537,['Z']=27922,['Yaw']=3.450516,['Pitch']=0,},[501]={['Contrast']=1.760000,['Roll']=3.141767,['Alpha']=0.750000,['SizeY']=560,['SizeX']=597,['Groups']=0,['EffectType']=431,['SizeZ']=560,['Color']=99,['X']=23706,['Y']=11815,['Id']=2540,['Z']=27290,['Yaw']=2.192134,['Pitch']=1.570971,},[502]={['Contrast']=1.750000,['Roll']=3.141767,['Alpha']=0.750000,['SizeY']=580,['SizeX']=419,['Groups']=0,['EffectType']=431,['SizeZ']=580,['Color']=99,['X']=23582,['Y']=11755,['Id']=2541,['Z']=27737,['Yaw']=1.336922,['Pitch']=1.570971,},[503]={['SizeY']=17,['Contrast']=1.250000,['EffectType']=4404,['Alpha']=0.800000,['Y']=11529,['SizeX']=85,['Groups']=1,['Color']=454545,['SizeZ']=17,['Roll']=0,['MetaData']={['message']='VAULT 7B',},['X']=23578,['Id']=2543,['Z']=27820,['Yaw']=4.949754,['Pitch']=0,},[504]={['SizeY']=52,['Contrast']=1.400000,['EffectType']=8501,['Alpha']=1,['Y']=11754,['SizeX']=30.456456,['Groups']=1,['Color']=350700,['SizeZ']=52,['Roll']=0,['MetaData']={['message']='\\nAgamemno Contingency, note section.\\n\\nBasic counters to other Justice League members require further research.\\n\\n\\nFlash : Paralysis..?\\n\\nGreen Arrow : immobilize one of his arms.\\n\\nZatanna : trachea trauma, a well timed blow would easily do the trick.\\n\\nRed Tornado : EMP.\\n\\nFirestorm : Phantom Zone..? Lack of raw material should nullify his powers.\\n\\nAquaman : Hydrophobia. Investigate modification of Scarecrow\\'s fear toxin.\\n\\nBlack Canary : Tear gas. If administered quickly enough should cut off her ability to speak and scream. Alternatively, I have recordings of her scream which have played back at equal intensity can cancel out the sound waves.',['title']='-Data 4-',},['X']=22670,['Id']=2544,['Z']=27984,['Yaw']=0.261799,['Pitch']=0,},[505]={['SizeY']=15,['Contrast']=1.860000,['EffectType']=4404,['Alpha']=0.660000,['Y']=11707,['SizeX']=123,['Groups']=2.400000,['Color']=999451,['SizeZ']=15,['Roll']=0,['MetaData']={['message']='Story    Section',},['X']=22677,['Id']=2545,['Z']=27922,['Yaw']=3.450516,['Pitch']=0,},[506]={['SizeY']=52,['Contrast']=1.540000,['EffectType']=8501,['Alpha']=1,['Y']=11754,['SizeX']=30.456456,['Groups']=1,['Color']=350700,['SizeZ']=52,['Roll']=0,['MetaData']={['message']='\\nIf these contingency plans are discovered in the wake of my being incapacitated, please understand, this had to be done for each of us, which brings us to...\\n\\n\\nAgamemno Contingency, codename: Detective.\\n\\nWhile Batman is a master strategist and combatant, he is only human. The best way to disable his strategic abilities would be to distract him, his parents are an excellent blind spot as is his endless crusade to protect the innocent, taking hostages is a good distraction, particularly if they\\'re friends or family...\\n\\nThink carefully before you do this.',['title']='-Data 5-',},['X']=22621,['Id']=2546,['Z']=28000,['Yaw']=0.261799,['Pitch']=0,},[507]={['SizeY']=20,['Contrast']=2.120000,['EffectType']=4401,['Alpha']=0.460000,['Y']=11760,['SizeX']=17,['Groups']=3.800000,['Color']=999999,['SizeZ']=20,['Roll']=0,['MetaData']={['message']='AG CO\\n-Data 1-',},['X']=22834,['Id']=2547,['Z']=27931,['Yaw']=3.349287,['Pitch']=0,},[508]={['SizeY']=20,['Contrast']=2.200000,['EffectType']=4401,['Alpha']=0.460000,['Y']=11760,['SizeX']=17,['Groups']=3.800000,['Color']=999999,['SizeZ']=20,['Roll']=0,['MetaData']={['message']='AG CO\\n-Data 2-',},['X']=22785,['Id']=2548,['Z']=27944,['Yaw']=3.349287,['Pitch']=0,},[509]={['SizeY']=20,['Contrast']=2.100000,['EffectType']=4401,['Alpha']=0.460000,['Y']=11760,['SizeX']=17,['Groups']=3.800000,['Color']=999999,['SizeZ']=20,['Roll']=0,['MetaData']={['message']='AG CO\\n-Data 3-',},['X']=22733,['Id']=2549,['Z']=27958,['Yaw']=3.349287,['Pitch']=0,},[510]={['SizeY']=20,['Contrast']=2.250000,['EffectType']=4401,['Alpha']=0.460000,['Y']=11759,['SizeX']=17,['Groups']=3.800000,['Color']=999999,['SizeZ']=20,['Roll']=0,['MetaData']={['message']='AG CO\\n-Data 4-',},['X']=22668,['Id']=2550,['Z']=27980,['Yaw']=3.349287,['Pitch']=0,},[511]={['SizeY']=20,['Contrast']=2.250000,['EffectType']=4401,['Alpha']=0.460000,['Y']=11759,['SizeX']=17,['Groups']=3.800000,['Color']=999999,['SizeZ']=20,['Roll']=0,['MetaData']={['message']='AG CO\\n-Data 5-',},['X']=22617,['Id']=2551,['Z']=27993,['Yaw']=3.349287,['Pitch']=0,},[512]={['Contrast']=1,['Roll']=0,['Alpha']=0.750000,['SizeY']=93,['SizeX']=376,['Groups']=0,['EffectType']=878,['SizeZ']=93,['Color']=0,['X']=22689,['Y']=11748,['Id']=2552,['Z']=27981,['Yaw']=3.452261,['Pitch']=0,},[513]={['Contrast']=1,['Roll']=0,['Alpha']=0.320000,['SizeY']=40,['SizeX']=38,['Groups']=0,['EffectType']=880,['SizeZ']=40,['Color']=390036,['X']=22988,['Y']=12542,['Id']=2556,['Z']=28124,['Yaw']=1.570796,['Pitch']=4.712564,},[514]={['Contrast']=1,['Roll']=3.141767,['Alpha']=0.540000,['SizeY']=3,['SizeX']=3,['Groups']=0,['EffectType']=880,['SizeZ']=3,['Color']=999999,['X']=22717,['Y']=12550,['Id']=2557,['Z']=28124,['Yaw']=0,['Pitch']=4.967207,},[515]={['Contrast']=1,['Roll']=0,['Alpha']=0.360000,['SizeY']=30,['SizeX']=30,['Groups']=0,['EffectType']=880,['SizeZ']=30,['Color']=0,['X']=22988,['Y']=12543,['Id']=2558,['Z']=28123,['Yaw']=1.570796,['Pitch']=4.712564,},[516]={['SizeY']=46,['Contrast']=1,['EffectType']=8502,['Alpha']=1,['Y']=11593,['SizeX']=35.456456,['Groups']=1.380000,['Color']=744529,['SizeZ']=46,['Roll']=0,['MetaData']={['message']='There was no way the technologies of this land would be enough to take us back home. So for the past months, Diana and I have crossed the continent, in hope to find mages that could help us.\\n\\nUnfortunatly, but not surprising, they were all either busy with the war, or had more important things to do. And with the current events that occured on Tamriel, it was better that we kept low profil about our story anyway..\\n\\nI kept thinking about this Fairgone, and the fact he went on Earth somehow, even if it was a different one, it could be a start. So I came back to Drizzt -And met his father and daughter in the process- to ask him about him, and he told me that Fairgone, to my surprise, also came from his world, Fearun...\\n\\nBut if it wasn\\'t enough, he also told me that he had a portal, at his house, to go back there at will, especially at Fairgone\\'s place. All those months, and I just learned that this Elf had a way with dimentional portals... The irony is that he was the first one Diana met upon landing, and he just appeared to be the key for us returning home.. I am a believer in coincidences, but sometimes, I believe that things happen for a reason as well, that maybe, in a way, fate plays a part on it. And this was too huge, too convenient to be some sort of random luck.\\n\\nAnd so Drizzt and I traveled to Fearun, to meet Fairgone\\'s father, Mallic. According to Drizzt, Mallic was a strong wizard, and was the one who created those portals. I am not confortable with magic, but I was ready to trust him on that, which is a lot coming from me, but I was also (and mainly) lacking other options...\\n',['title']='Part 8 : Back to the starting point',},['X']=22777,['Id']=2598,['Z']=27920,['Yaw']=3.433063,['Pitch']=4.712564,},[517]={['SizeY']=46,['Contrast']=1,['EffectType']=8502,['Alpha']=1,['Y']=11593,['SizeX']=35.456456,['Groups']=1.380000,['Color']=744529,['SizeZ']=46,['Roll']=0,['MetaData']={['message']='The meeting was delayed by a lot of talks with Drizzt. He was curious about my world, as I was with his. I was, just like with Tamriel the first times, struck by some strong similarities with antique Earth architectures, especially ancient Roman in this case. \\n\\nThe vegetation was also identical to what one can find on our world.. Did I stumbled upon another alternative Earth ? \\n\\nDrizzt and I exchanged a few words about both our homes. I even introduced him to a camera, which he had some fun toying with, and showed him a few pictures of Metropolis and Gotham. He thought they were built by Elves, but was surprised to learn that Earth didn\\'t had any, and never did in the past.. He believed it may be the reason Earth was lacking this much magic, as it is apparently them, in many worlds, who were the creators of it. Maybe he is right. Must further investigate this theory...\\n\\nWhen we finally entered the villa, we were very welcomed by the familly, Drizzt seemed nervous about getting in, and explained me it was because of  the Drows\\'s reputation. He was however concidered a member of their familly, and I bet Mr. Freeze himself could have felt the warmth in this house.\\n\\nAs I expected, Fairgone had told them about me, and I can\\'t hide the awkwardness of the situation, being introduced as a fictitious character, and not an actual being, and so for a good chunk of the dinner, I was rather mocked by two apparent mutants, who had fun with it. It was embarassing, but as I learnt later that they were in fact Dragons (naturally...), it then made more sense. Non of the less, I felt thankful for Drizzt, and even Fairgone for helping.\\n\\nIt took some to convince Mallic, but eventually, he accepted to help me. Bits of my blood was needed for the portal, and it was now just a matter of time.',['title']='Part 9 : An interesting dinner',},['X']=22726,['Id']=2610,['Z']=27938,['Yaw']=3.443535,['Pitch']=4.712564,},[518]={['SizeY']=9,['Contrast']=1,['EffectType']=4401,['Alpha']=0.640000,['Y']=11597,['SizeX']=18,['Groups']=1,['Color']=494949,['SizeZ']=9,['Roll']=0,['MetaData']={['message']='Part 8',},['X']=22772,['Id']=2611,['Z']=27912,['Yaw']=3.436553,['Pitch']=4.712564,},[519]={['SizeY']=9,['Contrast']=1,['EffectType']=4401,['Alpha']=0.700000,['Y']=11597,['SizeX']=18,['Groups']=1,['Color']=494949,['SizeZ']=9,['Roll']=0,['MetaData']={['message']='Part 9',},['X']=22723,['Id']=2612,['Z']=27930,['Yaw']=3.436553,['Pitch']=4.712564,},[520]={['SizeY']=46,['Contrast']=1.680000,['EffectType']=8502,['Alpha']=1,['Y']=11564,['SizeX']=35.456456,['Groups']=3.500000,['Color']=446944,['SizeZ']=46,['Roll']=0,['MetaData']={['message']='-Waylon Jones; A.k.a Killer Croc-\\n\\nThe extreme form of \"Epidermolytic hyperkeratosis\" that Waylon Jones was born with appeared, at first, to be irreversible. As time passes, his transformation into a full reptile seems inevitable. Yet, continuous researches and experiments on the mutated cells show a possible solution.\\n\\nAn increased gene therapy, using siRNA, targets the mutant K10 gene. The process was meant to create a protein that does not affects normal K10 gene products, but destroys the RNA molecules with specific sequences. \\n\\nResearches indicate that a nanotechnology-based technique, using spherical nucleic acids, in high doses, can suppress the production of the abnormal keratin 10 gene, and allow the normal K10 genes to function properly, building healthy skin tissues. \\n\\nUnfortunatly, Jones\\'s mutation seems to adapt rapidly to most long term medications given so far, making him a unique case, and a nearly impossible one to treat. \\n\\n-Nora Fries-\\n\\nOver the years, Victor Fries and I have conducted researches, with most of them leading to a dead end. \\n\\nTreating MacGregor\\'s Syndrome can be easly done when it\\'s only at stage 1 to 2. But Nora suffers from stage 4, which so far, doesn\\'t have a cure. Most promising results involved micro-cryogenic surgeries, and potentialy organ transplants. \\n\\nThe disease originaly attacks the lungs. But at Stage 4, it\\'s terminal phase, it had reached many tissues, and most organs, making any chances of potential recovery, to virtually zero percent. \\n\\n',['title']='Notes on some experiments',},['X']=20868,['Id']=2613,['Z']=27869,['Yaw']=4.131194,['Pitch']=4.712564,},[521]={['Contrast']=1,['Roll']=0,['Alpha']=0.540000,['SizeY']=50,['SizeX']=40,['Groups']=0,['EffectType']=878,['SizeZ']=50,['Color']=0,['X']=20868,['Y']=11560,['Id']=2614,['Z']=27866,['Yaw']=4.129449,['Pitch']=4.712564,},[522]={['SizeY']=46,['Contrast']=1,['EffectType']=8502,['Alpha']=1,['Y']=11593,['SizeX']=35.456456,['Groups']=1.300000,['Color']=744529,['SizeZ']=46,['Roll']=0,['MetaData']={['message']='While the portal was under crafting, I\\'ve been brought to some interesting places. Again, the architectures were familliar, but slightly more Alien looking than Tamriel.\\n\\nI also had what I concider a real conversation with Fairgone, for the first time. Learning a bit about his past, how he is dealing with it at the moment, I couldn\\'t help, but to relate, in an odd way. We both didn\\'t had a happy start, or at least, my happy one ended badly. I could sense that he was not someone easly scared. In another reality, he would have made a great Robin...\\n\\nOut of all the oddities that I\\'ve experienced since, the icing on the cake was when he showed me a \"Batman\" movie, that he kept at home. One made in 1989. I could not believe they\\'ve cast Bettlejuice to play me, he would have been a better Joker, but I have to admit Jack Nicholson felt oddly too familiar with the real one, he was too perfect. I didn\\'t liked the movie overall, particularly the part where this version kills, which completly took me out of it. The Joker never killed my parents, and even when I found Joe Chill, I couldn\\'t bring myself to take him down for good.\\n\\nIt was time, the portal was ready, and Diana joined us. After some goodbyes with the familly, I could see she was really affected by leaving Drizzt behind, and I, myself, felt a small pinch in my heart with leaving Fairgone... But we\\'ve waited long enough.\\n\\nOn our way back, we directly teleported at the station, no time to say hi to Alfred, we had to be quick. I equiped myself with a prototype Kryptonian armor, which granted me a strength nearly matching Superman. From there, we teleported to the ship, which was where the fight with Darkseid happened. \\n\\nWe were ready for round two.\\n',['title']='Part 10 : Returning home',},['X']=22665,['Id']=2616,['Z']=27958,['Yaw']=3.443535,['Pitch']=4.712564,},[523]={['SizeY']=9,['Contrast']=1,['EffectType']=4401,['Alpha']=0.750000,['Y']=11597,['SizeX']=18,['Groups']=1,['Color']=494949,['SizeZ']=9,['Roll']=0,['MetaData']={['message']='Part 10',},['X']=22661,['Id']=2617,['Z']=27950,['Yaw']=3.436553,['Pitch']=4.712564,},[524]={['SizeY']=46,['Contrast']=1.160000,['EffectType']=8502,['Alpha']=1,['Y']=11593,['SizeX']=35.456456,['Groups']=1.360000,['Color']=744529,['SizeZ']=46,['Roll']=0,['MetaData']={['message']='It took us about a minute to join them. By the time we did, Superman had allready managed to free himself from Darkseid, but most members were in a rather bad shape. Diana and I charged at him, not wasting more time. \\n\\nThe combat was intense, and long. We gave all we\\'ve got, beyond our maximum capacities. Luthor gave us a hard time, but was out cold way before we could do any form of real damage to Darkseid. After a couple hours, only Superman, Diana, and I remained standing. But my armor was heavly damaged, Diana had a borken arm, and Clark, probably a concussion or two...\\n\\nHowever, having prepared myself for months, I knew exactly what to do. I had time to study his machine for all this time, in depth, using the blueprints I had with me when landing on Tamriel, so at several moments during the battle, while the two were distracting him, I implemented some advanced EMP charges at key points, around the core, and waited for the perfect moment. I had brought a fragment of contained raw Sun energy, for Superman, and gave it to him. He was charged, beyond normal state, and lashed on Darkseid with all his might, actually gaining the upper hand quickly. When he placed him in the right spot, I triggered the EMP charges, and the core implosed, created a focused beam of energy from all it had harvested so far, all aimed directly at the dark God.\\n\\nThe injuries he recieved forced him to retreat rapidly, without a word, no longer able to fight. He left Luthor behind, and teleported away, with the remains of his army. \\n\\nWe were victorious.. But once again, it took all we had to achieve it, and we all knew it was a matter of time before he strikes back. Luthor was brought in Arkham, and I came back home, to rest. \\n\\nFor the first time, my body told me I was not so young anymore...',['title']='Part 11 : Victory, until the next time',},['X']=22615,['Id']=2618,['Z']=27974,['Yaw']=3.443535,['Pitch']=4.712564,},[525]={['SizeY']=9,['Contrast']=1.080000,['EffectType']=4401,['Alpha']=0.750000,['Y']=11597,['SizeX']=18,['Groups']=1,['Color']=494948,['SizeZ']=9,['Roll']=0,['MetaData']={['message']='Part 11',},['X']=22612,['Id']=2619,['Z']=27965,['Yaw']=3.436553,['Pitch']=4.712564,},[526]={['Contrast']=1.400000,['Roll']=0,['Alpha']=1,['SizeY']=4,['SizeX']=4,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=7975,['X']=16107,['Y']=12376,['Id']=2626,['Z']=32458,['Yaw']=1.864012,['Pitch']=5.469862,},[527]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.560000,['SizeY']=4,['SizeX']=22,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=0,['X']=16356,['Y']=12351,['Id']=2627,['Z']=32719,['Yaw']=2.136283,['Pitch']=4.712564,},[528]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.540000,['SizeY']=4,['SizeX']=4,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=0,['X']=16347,['Y']=12351,['Id']=2628,['Z']=32715,['Yaw']=2.136283,['Pitch']=4.712564,},[529]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.910000,['SizeY']=4,['SizeX']=4,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=3399,['X']=16342,['Y']=12352,['Id']=2629,['Z']=32718,['Yaw']=2.136283,['Pitch']=4.712564,},[530]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.910000,['SizeY']=4,['SizeX']=4,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=99,['X']=16345,['Y']=12352,['Id']=2630,['Z']=32723,['Yaw']=2.136283,['Pitch']=4.712564,},[531]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.910000,['SizeY']=4,['SizeX']=4,['Groups']=0,['EffectType']=878,['SizeZ']=4,['Color']=30099,['X']=16348,['Y']=12352,['Id']=2631,['Z']=32728,['Yaw']=2.136283,['Pitch']=4.712564,},[532]={['Contrast']=1.400000,['Roll']=0,['Alpha']=0.91000