R["oh__@ayalockheart"]="{['eu']={[70]={['N']='Crystal Palace',['O']=18784,['C']=1.017000,},[71]={['N']='Hytta',['O']=18686,},[41]={['N']='Welkynd Ruins',['O']=18772,['C']=1.021000,},[75]={['N']='Fojimasuta Ryokan',['O']=18874,['C']=1.014000,['D']='Version 1.0 - 2020\\n\\rVersion 2.0 - 2021\\n\\nA japanese onsen (温泉) ryokan (旅館) (hot spring inn) is a inn that carries on the traditions of old age Japanese culture. After soaking in the \"onsen\", change into a “yukata” (浴衣) robe, enjoy a Japanese multi-course dinner \"kaiseki\"  (懐石), and relax in traditional tatami (畳) rooms… Onsen ryokans give you the complete experience of the heart of Japanese traditional culture.\\n\\n- Following cultural traditions and aesthetics to resemble an autentic Ryokan. - ',},[12]={['N']='Emberfall',['O']=18755,['C']=1.041000,},[78]={['N']='Solitude Townhouse',['O']=18686,},[47]={['N']='The Prydwen',['O']=18755,['C']=1.027000,},[80]={['N']='Hogsmeade',['O']=18928,['C']=1.020000,['D']='“What\\'s Hogsmeade like? Where did you go?\"\\r\\nBy the sound of it- everywhere.  Zonko\\'s Joke Shop, into the Three Broomsticks for foaming mugs of hot butterbeer, and many places besides.\\r\\n\"Olivanders, Harry! About 500 hundred wands, all sitting on shelves, all coded depending on what wood and core them are made of!\"\\r\\n\"Honeydukes has got a new kind of fudge; they were giving out free samples, there\\'s a bit, look-\"\\r\\n\"We think we saw an ogre, honestly, they get all sorts at the Three Broomsticks-\"\\r',},[49]={['N']='Ground\\'s Keeper Hut',['O']=18763,['C']=1.036000,},[20]={['N']='Perl Among Corals',['O']=18759,['C']=1.012000,},[17]={['N']='The Drowsy Stag',['O']=18846,['C']=1.007000,['D']='As you enter through the heavy, wooden door, you\\'re welcomed by amazing, but unknown scents and a layer of smoke hanging below the ceiling.\\r\\nThe bartender is pouring a drink for a customer and makes no effort to acknowledge your presence.\\r\\n\\r\\nYou did hear rumors about this place, supposedly it\\'s infamous for something, but for the life of you you can\\'t remember what for. \\r\\nThough judging by the figures lurking in the shadows, it\\'s probably some dirty business.',},[54]={['N']='Frostguard Fortress',['O']=18755,['C']=1.017000,},[23]={['N']='Ivory Oasis',['O']=18772,['C']=1.021000,},[24]={['N']='Ch������teau Blanc',['O']=18759,['C']=1.007000,},[25]={['N']='Golden Mug Caffe',['O']=18772,['C']=1.045000,},[15]={['N']='Homestead',['O']=18807,['C']=1.047000,},[59]={['N']='HollowJck PartyHouse',['O']=18921,['C']=1.038000,['D']='     |t64:64:esoui\\\\art\\\\icons\\\\event_halloween_2016_skull_cup_grapes.dds|t \\r\\n|cFF8C00Trick or Treat\\r\\nHere’s Something Neat\\r\\nWe’re Having a Party\\r\\nThat Can’t be Beat\\r\\n\\r\\nGuess the reference\\r\\nof each malevolence\\r\\nShall 5/8 be right\\r\\nYou\\'ll get a treat tonight\\r\\n\\r\\n1) Mail me your guesses\\r\\n2) Take a pic w/ your costume in the house and send it to ayalockheart@gmail.com|r',},[7]={['N']='TSS Rumare',['O']=18853,['C']=1.027000,['D']='Commanded by the Emperor of Cyrodil a small crew boards TSS Rumare to head fifty thousand leagues under the sea of Tamriel\\n to seek and destroy the mysterious monster that is bringing fear (once again) among khajiit fishing villages.',},[61]={['N']='Lost Cult (limited)',['O']=18759,['C']=1.041000,},[16]={['N']='Hallix\\'s Elixirs',['O']=18861,['C']=1.007000,['D']='Bastian perceived greater value for his life therefore leave the Silvelles was the right thing to do. Closer to his kin, he decided to start over.',},[6]={['N']='Mournhold Apartment',['O']=18875,['C']=1.033000,['D']='\\rIt is colder and raining outside. You travelled from so far. \\r\\nYou step inside leaving all worries of Nirm outside. \\r\\n\"Just a little rest\", you think... sitting near the firewood stove, the tiny ember become a bright orange flame.  \\r\\nIt starts to feel warmer and your body relaxed. Your dripping wet cloaths are soon to be dry again.\\r\\nGazing the crackling of the firewood give you some peace and you start to slowly fall asleep.\\n\\n*Enjoy it along w/ your favorite: rain and crackling firewood ASMR.* ',},},['Version']=1764,['TS']=1635445571,['na']={},['Key']='oh__@ayalockheart',}"
