 / Sweatlodge\\nPrivate bath available upon request\\nOvernight lodging available\\nManager lives on-site\\n\\nOur restaurant is open from 6am to midnight.\\nAlchoholic drinks served between the hours of 1pm and 3am.\\nThe sweat lodge sauna operates from 3pm to 10pm\\n\\nAlchoholic drinks are permitted in all of our bathing facilities.  Please wait a while before using the sauna if you have had more than one drink.  At least two people must be in the sauna at all times and coverings are required.\\n\\nChildren and infants MUST be attended by an adult at all times.  Speak to one of our attendants if you require sitting while you relax!  They MUST be attended by an adult on any of our Dwarven animal rides.\\n\\nOur facilities are open and available to everyone, and know that you are safe and welcome and here.  There is a men\\'s public bath and a women\\'s public bath, however, if you would like to choose your bath based on spirit, politely notify one of our courteous attendants so that they are aware.  Our premise is guarded all hours of the day.  You and your company can also request an escort to your bath, or to stand guard outside it.\\n\\nThe Ard\\'s Bath is also available to anyone upon request.  Our very own Ard Caddach prefers our private bath, which is entirely fit for an Ard!  Couples or those who prefer to bathe alone, inquire.  Can accomodate up to a company of 7.',['title']='Bath House Information',},['Alpha']=1,['EffectType']=8503,['Contrast']=1,['Y']=32017,},[7]={['Roll']=0,['Groups']=0,['SizeY']=40,['SizeX']=94.222222,['Pitch']=0,['Color']=999999,['Z']=64910,['Yaw']=2.617994,['SizeZ']=40,['X']=19710,['Id']=1240,['Alpha']=1,['Contrast']=1,['Y']=32593,['EffectType']=5070,},[8]={['Roll']=0,['Id']=1242,['Groups']=0,['SizeY']=2,['Pitch']=0,['Yaw']=3.141593,['Color']=999999,['Z']=65618,['SizeX']=20,['SizeZ']=2,['X']=26243,['MetaData']={['message']='Men\\'s bath',},['Alpha']=1,['EffectType']=4402,['Contrast']=1,['Y']=49121,},},['World']='na',['Version']=1724,