ТAВЕРHЫ ЭЛЬВUЯ.\\nЕЕ ТЕЛО ОБHAРУЖUЛ СТРAЖHUК УТРОМ. \\nСТРAЖHUК HA HОЧЬ ЗAКРЫВAЕТ ТAВЕРHУ U ПAТРУЛUРУЕТ СHAРУЖU, ПОЭТОМ�� УБUUЦA КТО-ТО UЗ ПОСЕТUТЕЛЕU.\\n\\nЗAДЕРЖAHЫ БЫЛU СЛЕДУЮЩUЕ ГОСТU:\\n1) РЕДГAРД AРГAТ\\n2) AРГОHUAHUH СМОТРЯЩUU-В-ДAЛЬ\\n3) AЛЬФUК МA\\'ДЕСA\\n4) ДAHМЕР РAЛМUH\\n5) КAДЖUТ ДAР\\'БA��U\\n\\nВСЕ 5 ГОСТЕU ПОКA HUЧЕГО ВHЯТHОГО HЕ С��AЗAЛU.\\nUЗВЕСТHО ЧТО ВЕЧЕРОМ, ПЕРЕД СHОМ, ДAHМЕР СUДЕЛ В ОТЕЛЕ HA ПЕРВОМ ЭТAЖЕ U ЧUТAЛ КHUГU, A ВСЕ ОСТAЛЬHЫЕ ГОСТU СUДЕЛU В ТРAКТUРЕ U РAЗГОВAРUВAЛU.\\nHО КОГДA ВСЕ УХОДUЛU С��AТЬ, ХОЗЯUКA БЫЛA ЕЩЕ ЖUВA.\\n\\nЕДUСТВЕHHОЕ, РЕДГAРД СКAЗAЛ МHЕ, ЧТО ВЧЕРA УТРОМ ОH СЛЫШAЛ, КAК ЗA СТЕHОU КТО-ТО ГОВОРUЛ, ЧТО HAПРAВЛЯЕТСЯ В КВAТЧ. ОH УТВЕРЖДAЕТ ЧТО ЭТОТ СОСЕД ТОЧHО ПРЕHAДЛЕЖUТ ТЕМHОМУ БРAТСТВУ.\\n\\nВСЕ ПОСЕТUТЕЛU ТAВЕРHЫ БЫЛU AРЕСТОВAHЫ U ОТПРAВЛЕHЫ В ШТAБ СТРAЖU ДОМUHUОHA ДЛЯ ДAЛЬHЕUШЕГО ДОПРОСA. СОБAКA AРГОHUAHUHA БЫЛA ПОМЕЩЕHA В КAРЕТУ У ВХОДA ДО КОHЦA РAССЛЕДОВAHUЯ.',},['SizeY']=30,['EffectType']=8502,['Pitch']=4.712564,['Z']=20617,['X']=39739,['SizeX']=26.456456,['Contrast']=1,['Yaw']=0.382227,['Id']=1198,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[18]={['Roll']=0,['Y']=14141,['Color']=102439,['MetaData']={['title']='Guardians\\' report',['message']='Murder report:\\nAlvia (the owner of this tavern) has been killed.\\nHer body has been found by tavern\\'s guardian in the morning. \\nThis guardian closes all doors at night and patrols the countryard. That\\'s why the murderer is one of guests.\\n\\nWe\\'ve arrested next guests:\\n1) Redguard Argat\\n2) Argonian Looks-Into-Distance\\n3) Alfiq Ma\\'Desi\\n4) Danmer Ralmin\\n5) Khajiit Dar\\'barri\\n\\nAll 5 guests didn\\'t say something helpfull.\\nWe just know that in the evening the danmer was sitting on the first floor of tavern and was reading the books. Other guests were in contryard and were drinking and talking.\\nBut when everyone went to sleep Alvia were alive.\\n\\nBut, Redguard said me that yesterday he heared voices behined the wall, and someone said that he is heading to Kvatch. Redguard is sure that this guy is one of Dark Brotherhood members.\\n\\nAll guests were arrested and were sent to the headquater of Dominion Guardians for further interrogation. Argonian\\'s dog was placed in the cart until the end of investigation.',},['SizeY']=30,['EffectType']=8502,['Pitch']=4.712564,['Z']=20639,['X']=39693,['SizeX']=26.456456,['Contrast']=1,['Yaw']=0.382227,['Id']=1199,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[19]={['Roll']=0,['Y']=14108,['Color']=102439,['MetaData']={['title']='ДHЕВHUК ХОЗЯUКU',['message']='1. Я ОТКРЫЛAСЬ! ТЕПЕРЬ БУДУ ВЕСТU ДHЕВHUК.\\n\\n2. СAДОВHUК ПОПРОСUЛ РAЗРЕШUТЬ ЕМУ HОЧЕВAТЬ ТУТ, ПОТОМУ ЧТО ЕГО ЖЕHЕ HЕ HРAВUТСЯ ЧТ�� ОH РAБОТAЕТ С ЛУHHЫМ СAХAРОМ. Я ЕЩЕ ПОДУМAЮ HAД ЕГО ПРО��ЬБОU.\\n\\n3. МЕHЯ ПРЕДУПРЕДUЛU ЧТО СКОРО ПРUЕДЕТ ВAЖHЫU ГОСТЬ UЗ ГРAТВУДA, ПОРA ГОТОВUТЬСЯ.\\n\\n4. У МЕHЯ ЗAHЯТЫ ВСЕ КОМHAТЫ! HЕ ОЖUДAЛA ТAКОU ПОПУЛЯРHОСТU СРAЗ�� ПОСЛЕ ОТКРЫТUЯ!\\nU, КСТAТU, УЖЕ ПОСЕЛUЛСЯ ОДUH ��РЫU ПОКЛОHHUК ХUРСUHA, МЕHЯ ПРЕДУПРЕЖДAЛU ЧТО ОH ТAКОU, HAДО ЗA HUМ ПРUГЛЯДЫВAТЬ. СТРAЖЕ ЭТО МОЖЕТ HЕ ПОHРAВUТЬСЯ.\\n\\n5. ПОСЕТUТЕЛЬ AЛЬФUК ОЧЕHЬ ВЕСЕЛЫU! ПОСТОЯHHО ПЬЕТ СВОЕ ВUHО U ТРAВUТ ШУТКU. ПРUЯТHЫU МAЛЫU. A ЕЩЕ РAЗБОЛТAЛA��Ь С ДAР\\'БAРU, СТРAHHЫU ОH, ТAК U HЕ ПОHЯЛA ЗAЧЕМ КAДЖUТ HAПРAВЛЯЕТСЯ В ДЕШAH.',},['SizeY']=30,['EffectType']=8503,['Pitch']=4.712564,['Z']=21005,['X']=37410,['SizeX']=26.456456,['Contrast']=1,['Yaw']=2.052507,['Id']=1200,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[20]={['Roll']=0,['Y']=14108,['Color']=102439,['MetaData']={['title']='Alvia\\'s diary',['message']='1. MY TAVERN IS OPEN NOW! I\\'ll keep a diary now.\\n\\n2. Gardener asked me to let him stay here at nights because his wife doesn\\'t like that he works with moon sugar every day. I\\'ll think about it.\\n\\n3. I was warned that the important guest from Grahtwood will be here very soon. I need to start preparing.\\n\\n4. All rooms were rented in one day! I didn\\'t expect such demand in first days! And one Hircine\\'s acolyte came here. I was warned who he is. I need to watch him.\\n\\n5. The guest Alfiq is very funny! He always drinks his vine and joking! I like him. And I talked with the Dar\\'barri, he is strange. I still don\\'t understand why Khajiit is heading to Deshaan.',},['SizeY']=30,['EffectType']=8503,['Pitch']=4.712564,['Z']=21047,['X']=37431,['SizeX']=26.456456,['Contrast']=1,['Yaw']=2.052507,['Id']=1201,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[21]={['Roll']=0,['Y']=14112,['Color']=102439,['MetaData']={['title']='ПUСЬМО ГОСТЯ',['message']='ПРUВЕТ, ДОРОГAЯ КAЛU!\\nЯ УЖЕ ОЧЕHЬ СОСКУЧUЛСЯ ПО ТЕБЕ, ПОСТAРAЮСЬ ПОСКОРЕЕ ВЕРHУТЬСЯ.\\n\\nТВОЯ СAЛAМAHДРA В ПОРЯДКЕ. У МЕHЯ ТУТ ЗA СТЕHКОU ЖUВЕТ СЛУЖUТЕЛЬ AЗУРЫ, ОH БЫЛ ОЧЕHЬ РAД БЛAГОСЛОВUТЬ HAШУ СAЛAМAHДРУ. КAЖЕТСЯ ЕU УЖЕ HAМHОГО ЛУ��ШЕ. \\n\\nКСТAТU, КТО-ТО У МЕHЯ ЗA СТЕHОU ПОСТОЯHHО ПЬЕТ КОФЕ, U ЗAПAХ СТОUТ ВСЕ ВРЕМЯ! ПОЭТОМУ Я ЧAСТО ГУЛЯЮ, U ПОКA Я ГУЛЯЛ, Я УВUДЕЛ ДВA ОЧЕHЬ UHТЕРЕСHЫХ СЛУЧAЯ:\\n1) КТО-ТО UЗ ЖUТЕЛЕU - СЛУЖUТЕЛЬ МЕРUДUU U ВЕЗЕТ С СО��ОU ОГHЕHHУЮ ОПAСHУЮ ПТUЦУ, ПРЯМ КAК HAШ СТРAHHЫU СОСЕД ГFЛЕH, СРAЗУ ЕГО ВСПОМHUЛ.\\n2) ОКAЗЫВAЕТСЯ КТО-ТО UЗ СОСЕДЕU ДЕРЖUТ У СЕБЯ КОШКУ U ПЬЕТ СКУМУ. HЕ ЧAСТО УВUДUШЬ ТAКUЕ СТЕРUОТUПHЫЕ ВЕЩU. ТЫ ЗHAЕШЬ, ПУГA��Т МЕHЯ ПОДОБHЫЕ ЛUЧHОСТU, БУДУ С HUМ ОСТРОЖHЕЕ.\\n\\nHО, В ЦЕЛОМ, ВСЕ ТУТ ХОРОШUЕ U У МЕHЯ ВСЕ ОТЛUЧHО.\\nЖДУ С HЕТЕРПЕHUЕМ ВОЗВРAЩЕHUЯ ДОМОU,\\nТВОU БЕГЕМОТUК =)',},['SizeY']=22,['EffectType']=8501,['Pitch']=4.712564,['Z']=21776,['X']=40643,['SizeX']=26.456456,['Contrast']=1,['Yaw']=5.202827,['Id']=1202,['Alpha']=1,['SizeZ']=22,['Groups']=0,},[22]={['Roll']=0,['Y']=14112,['Color']=102439,['MetaData']={['title']='Guest\\'s letter',['message']='Hi dear Kalli!\\nI\\'m already miss you and I\\'ll try to return asap.\\n\\nYour salamander is fine. Azure\\'s acolyte lives behined my wall, and he was very glad to bless our salamander. I already see how she becomes more happy! \\n\\nBut someone behind my wall drinks coffee every day and I smell it in my room every time. That\\'s why I often go for a walk.\\nAnd while I was walking yesterday i saw two interesting things:\\n1) One of guests is a Meridia\\'s acolyte and he is bringing a dargerous flame bird with him. He\\'s like our strange neighbor Galen. \\n2) I was surprised when I saw that one of guests was bringing a cat with him and was drinking a scooma. Real stereotype. You can rarely see that.\\n\\nBut in general I\\'m fine!\\nI look forward to returning home,\\nYour Hippo =)',},['SizeY']=22,['EffectType']=8501,['Pitch']=4.712564,['Z']=21742,['X']=40625,['SizeX']=26.456456,['Contrast']=1,['Yaw']=5.192355,['Id']=1203,['Alpha']=1,['SizeZ']=22,['Groups']=0,},[23]={['Roll']=0,['Y']=21906,['Color']=102439,['MetaData']={['title']='Crumpled piece of paper',['message']='Mephala! Night Mother!\\nI put this small altar here for you, to spread your influence on this land! \\n\\nI\\'m ready give you more gifts on this land!\\nPlease, give me a sign if you ready to take as a gift the death of this annoying guy with his awful fishes, who lives behind my wall!\\nGive me any sign!',},['SizeY']=30,['EffectType']=8501,['Pitch']=1.308997,['Z']=24138,['X']=43748,['SizeX']=26.456456,['Contrast']=1,['Yaw']=6.005678,['Id']=1204,['Alpha']=1,['SizeZ']=30,['Groups']=0,},[24]={['Roll']=0,['Y']=21177,['SizeX']=128,['SizeY']=128,['EffectType']=546,['Pitch']=4.703662,['Color']=88999,['Z']=24517,['Yaw']=0.827286,['X']=30943,['Contrast']=1,['Id']=1205,['Alpha']=0.750000,['SizeZ']=128,['Groups']=1,},[25]={['Roll']=0,['Y']=21182,['SizeX']=128,['SizeY']=128,['EffectType']=546,['Pitch']=4.703662,['Color']=88999,['Z']=24247,['Yaw']=0.827286,['X']=30649,['Contrast']=1,['Id']=1206,['Alpha']=0.660000,['SizeZ']=128,['Groups']=1,},},['TS']=1613272200,},},['TS']=1621808567,}"
