R["fx__@helisir"]="{['Houses']={[1]={['Version']='16.0.9',['HouseId']=15,['TS']=1610898272,['Effects']={[1]={['X']=25550,['SizeX']=26.456456,['Z']=65574,['Color']=102439,['Roll']=0,['Alpha']=1,['Contrast']=1,['SizeZ']=30,['EffectType']=8501,['Y']=23905,['SizeY']=30,['Id']=1002,['Yaw']=1.396263,['MetaData']={['title']='A Viking Wedding',['message']='There is little kown about Scandinavian weddings in the Viking age but scholars have pieced together what a viking wedding might have looked like. Here are some facts about how this big event went down.\\n\\nGetting married was more for financial reasons rather than love. Negotiations would be carried out between the bride and groom\\'s families to determine the financial assets, important connections, even the wedding gifts.\\n\\nBrides would be stripped of their old clothes and symbols of her unwed status. Then the bride would cleanse herself in a bathhouse which symbolically washed away the bride\\'s maiden status.\\n\\nFor the grooms, they would participate in a symbolic sword ceremony. This is done by the groom-to-be breaking into a grave to retrieve their family sword of an ancestor. Through this action, he entered death as a boy and emerged into life as a man, reborn. Once the groom has the sword, her would also go to the bathhouse, much like the bride, to purify himself for the wedding ceremony.\\n\\nDuring a Viking wedding, the groom would present the sword to the bride, which she kept for any future sons they might have. The bride would then gift the groom a sword from her ancestors, symbolizing a transfer of a father\\'s protection of the bride to the husdand. The bride and groom would then exchange rings to further consecrate thier wedding vows.\\n\\nOnce the ceremony had completed, a ritual called bride-running took place before the feast began. This ritual consisted simply of the bride and groom racing from the ceremony site to the feast site, and whoever lost the race sreved beer to the winners for the night. This ritual also symbolized the enduring nature of the union.\\n\\nIt was a legal requirement for the bride and groom to drink bridal-ale together at the feast.',},['Groups']=0,['Pitch']=4.729842,},},['World']='na',},},['TS']=1610898272,['Key']='fx__@helisir',}"
